import React, { useState, useEffect, useRef } from 'react';

const Star = ({ delay, duration }) => (
  <div
    className="absolute bg-white rounded-full animate-twinkle"
    style={{
      width: `${Math.random() * 3}px`,
      height: `${Math.random() * 3}px`,
      top: `${Math.random() * 100}%`,
      left: `${Math.random() * 100}%`,
      opacity: Math.random(),
      animation: `twinkle ${duration}s ease-in-out infinite`,
      animationDelay: `${delay}s`
    }}
  />
);

const ShootingStar = () => (
  <div
    className="absolute w-1 h-1 bg-white rounded-full"
    style={{
      top: `${Math.random() * 50}%`,
      left: '-2px',
      animation: 'shootingstar 3s linear infinite',
      animationDelay: `${Math.random() * 10}s`
    }}
  />
);

const TerminalPortfolio = () => {
  const [input, setInput] = useState('');
  const [history, setHistory] = useState([
    { type: 'output', text: 'Welcome to my portfolio terminal!' },
    { type: 'output', text: 'Type "help" to see available commands.' }
  ]);
  const [commandHistory, setCommandHistory] = useState([]);
  const [commandHistoryIndex, setCommandHistoryIndex] = useState(-1);
  const terminalRef = useRef(null);
  const inputRef = useRef(null);

  const commands = {
    help: [
      'Available commands:',
      '- about: Display personal information',
      '- skills: Show technical skills',
      '- projects: List of project highlights',
      '- contact: Get contact information',
      '- clear: Clear the terminal screen'
    ],
    about: [
      'Name: Gautam Vijan',
      'Role: STEM Mentor',
      'Location: Pune, India',
      "I'm a passionate developer with expertise in web technologies and a love for creating innovative solutions."
    ],
    skills: [
      'Languages: JavaScript, Python, TypeScript',
      'Frontend: React, Vue, Next.js',
      'Backend: Node.js, Express, Django',
      'Tools: Git, Docker, AWS',
      'Database: MongoDB, PostgreSQL'
    ],
    projects: [
      '1. Smart Home Automation Platform',
      '   - IoT-based home control system',
      '   - Technologies: React, Node.js, MQTT',
      '',
      '2. E-commerce Analytics Dashboard',
      '   - Real-time sales and user behavior tracking',
      '   - Technologies: Vue.js, D3.js, Firebase'
    ],
    contact: [
      'Email: gtmvijan@gmail.com',
      'LinkedIn: /in/gautamvijan',
      'GitHub: @gautamvijan',
      'Phone: 8279436251'
    ],
    clear: 'clear'
  };

  const handleCommand = (cmd) => {
    const trimmedCmd = cmd.trim().toLowerCase();
    if (trimmedCmd === 'clear') {
      setHistory([]);
      return [];
    }
    if (commands[trimmedCmd]) {
      return commands[trimmedCmd];
    }
    return trimmedCmd === '' 
      ? [] 
      : [`Command not found: ${trimmedCmd}. Type "help" for available commands.`];
  };

  const processCommand = () => {
    if (input.trim() === '') return;

    const trimmedCmd = input.trim().toLowerCase();

    if (trimmedCmd === 'clear') {
      setHistory([]); // Clear the history
      setInput('');  // Reset input
      setCommandHistoryIndex(-1);
      return;
    }

    const newCommandHistory = [...commandHistory];
    if (input.trim() !== '') {
      newCommandHistory.push(input.trim());
      setCommandHistory(newCommandHistory);
    }

    const newHistory = [
      ...history,
      { type: 'input', text: `> ${input}` },
      ...handleCommand(input).map(line => ({ type: 'output', text: line }))
    ];

    setHistory(newHistory);
    setInput('');
    setCommandHistoryIndex(-1);

    setTimeout(() => {
      if (terminalRef.current) {
        terminalRef.current.scrollTop = terminalRef.current.scrollHeight;
      }
    }, 10);
  };

  const handleKeyDown = (e) => {
    if (e.key === 'Enter') {
      processCommand();
      return;
    }

    if (e.key === 'ArrowUp') {
      e.preventDefault();
      if (commandHistoryIndex < commandHistory.length - 1) {
        const newIndex = commandHistoryIndex + 1;
        setCommandHistoryIndex(newIndex);
        setInput(commandHistory[commandHistory.length - 1 - newIndex]);
      }
    }

    if (e.key === 'ArrowDown') {
      e.preventDefault();
      if (commandHistoryIndex > -1) {
        const newIndex = commandHistoryIndex - 1;
        setCommandHistoryIndex(newIndex);
        setInput(newIndex === -1 ? '' : commandHistory[commandHistory.length - 1 - newIndex]);
      }
    }
  };

  useEffect(() => {
    if (inputRef.current) {
      inputRef.current.focus();
    }
  }, []);

  return (
    <div className="w-full h-screen bg-gradient-to-b from-black to-blue-900 text-green-400 font-mono flex justify-center items-center relative overflow-hidden">
      {/* Starry Background */}
      <div className="absolute top-0 left-0 w-full h-full pointer-events-none">
        {/* Static stars */}
        {Array.from({ length: 100 }).map((_, i) => (
          <Star 
            key={`star-${i}`} 
            delay={Math.random() * 5}
            duration={2 + Math.random() * 3}
          />
        ))}
        {/* Shooting stars */}
        {Array.from({ length: 5 }).map((_, i) => (
          <ShootingStar key={`shooting-${i}`} />
        ))}
      </div>

      {/* Terminal Window */}
      <div className="w-full max-w-4xl h-[80vh] bg-gray-900 bg-opacity-90 rounded-lg shadow-2xl overflow-hidden flex flex-col relative z-10 backdrop-blur-sm">
        <div className="bg-gray-800 p-2 flex justify-between items-center">
          <div className="flex space-x-2">
            <div className="w-3 h-3 bg-red-500 rounded-full"></div>
            <div className="w-3 h-3 bg-yellow-500 rounded-full"></div>
            <div className="w-3 h-3 bg-green-500 rounded-full"></div>
          </div>
          <div className="text-gray-300">Terminal - Gautam Vijan</div>
          <div></div>
        </div>

        <div ref={terminalRef} className="flex-1 p-4 overflow-y-auto">
          {history.map((item, index) => (
            <div
              key={index}
              className={item.type === "input" ? "text-yellow-300" : "text-green-400"}
            >
              {item.text}
            </div>
          ))}
          <div className="flex items-center">
            <span className="mr-2">{">"}</span>
            <input
              ref={inputRef}
              type="text"
              value={input}
              onChange={(e) => setInput(e.target.value)}
              onKeyDown={handleKeyDown}
              className="bg-transparent outline-none text-green-400 w-full"
              autoFocus
            />
          </div>
        </div>
      </div>
    </div>
  );
};

export default TerminalPortfolio;
